import React from 'react'

function Main(props) {
    return (
        <main>
            <div>
                <form>
                    <input type="search" 
                    onSubmit={props.searchInput} 
                    placeholder="search for an anime" 
                    required 
                    value={props.search} 
                    onChange={e => props.setSearch(e.target.value)}/>
                </form>
            </div>
        </main>
    )
}

export default Main
